-- 创建表: 机构
create table DM_JG
(
  JG_DM     VARCHAR(15) not null comment '机构代码',
  ZZJG_DZ      VARCHAR(20) comment '组织机构代码',
  JG_MC     VARCHAR(80) not null comment '机构简称',
  JG_JC     VARCHAR(50) not null comment '机构名称',
  JG_BZ     CHAR(1) not null comment '机构标志',
  SJ_JG_DM  VARCHAR(15) not null comment '上级机构代码',
  DWLSGX_DM VARCHAR(2) not null comment '机构级次代码',
  JG_JG     VARCHAR(10) comment '机构局轨',
  JGYB      VARCHAR(6) comment '机构邮编',
  JGDZ      VARCHAR(80) comment '机构地址',
  JGDH      VARCHAR(30) comment '机构电话',
  CZDH      VARCHAR(30) comment '传真电话',
  DYDZ      VARCHAR(50) comment '电邮地址',
  XZQH_DM   VARCHAR(15) comment '行政区划代码',
  JGFZR_DM  VARCHAR(11) comment '负责人',
  JBDM      VARCHAR(30) not null comment '级别代码',
  JCDM      CHAR(1) not null comment '级次代码',
  XYBZ      CHAR(1) default 'Y' not null comment '选用标志',
  YXBZ      CHAR(1) default 'Y' not null comment '有效标志',
  JG_ORDER  INT(5)
)comment '机构'
;

alter table DM_JG
  add constraint PK_DM_JG primary key (JG_DM);
alter table DM_JG
  add constraint CHK_DM_JG_1
  check ("JG_BZ"='J' OR "JG_BZ"='B' OR "JG_BZ"='Q');
create unique index IDX_DM_JG_JBDM on DM_JG (JBDM);

create or replace view v_dm_jg as
	select
	"JG_DM",
	"JG_MC",
	"JG_JC",
	"JG_BZ",
	"SJ_JG_DM",
	"DWLSGX_DM",
	"JG_JG",
	"JGYB",
	"JGDZ",
	"JGDH",
	"CZDH",
	"DYDZ",
	"XZQH_DM",
	"JGFZR_DM",
	"JBDM",
	"JCDM",
	"XYBZ",
	"YXBZ"
	from DM_JG
	where YXBZ = 'Y'
	and XYBZ = 'Y'
	order by JG_DM;


