-- 创建表: 操作人员
create table DM_CZRY
(
  CZRY_DM VARCHAR(11) not null comment '操作人员代码',
  JG_DM   VARCHAR(15) not null comment '机构代码',
  CZRY_MC VARCHAR(30) not null comment '操作人员名称',
  XYBZ    CHAR(1) default 'Y' not null comment '选用标志',
  YXBZ    CHAR(1) default 'Y' not null comment '有效标志',
  ZJHM    VARCHAR(18),
  ADDRESS VARCHAR(80),
  DHHM    VARCHAR(30),
  SJHM    VARCHAR(30),
  EMAIL   VARCHAR(50),
  ISMULPOSITION VARCHAR(2) comment '是否跨部门'
)comment '操作人员代码'
;

alter table DM_CZRY
  add constraint PK_DM_CZRY primary key (CZRY_DM);
alter table DM_CZRY
  add constraint FK_DM_CZRY_JG_DM foreign key (JG_DM)
  references DM_JG (JG_DM);
create index IDX_DM_CZRY_JG_DM on DM_CZRY (JG_DM);



