-- 创建表: 用户
create table QX_USER
(
  USERID    VARCHAR(11) not null comment '用户ID',
  NAME      VARCHAR(30) not null comment '用户名',
  CZRY_DM   VARCHAR(11) not null comment '人员代码',
  PASSWORD  VARCHAR(40) not null comment '口令',
  KLLX      VARCHAR(2) not null comment '口令类型',
  PWRQQ     TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP comment '口令起始日期',
  PWRQZ     TIMESTAMP NOT NULL DEFAULT '1999-01-01 01:01:01' comment '口令终止日期',
  GRANTROLE CHAR(1) comment '角色授权标记',
  USER_TYPE   CHAR(1),
  ACT_TYPE    CHAR(1),
  CREATE_TIME TIMESTAMP NOT NULL DEFAULT '1999-01-01 01:01:01',
  UPDATE_TIME TIMESTAMP NOT NULL DEFAULT '1999-01-01 01:01:01',
  ACT_TIME    TIMESTAMP NOT NULL DEFAULT '1999-01-01 01:01:01'
)comment '用户';
alter table QX_USER
  add constraint PK_QX_USER primary key (USERID);
alter table QX_USER
  add constraint FK_QX_USER_RY_DM foreign key (CZRY_DM)
  references DM_CZRY (CZRY_DM);
create unique index IDX_QX_USER_NAME on QX_USER (NAME);
create index IDX_QX_USER_RY_DM on QX_USER (CZRY_DM);


